import React from 'react';
import Staffnavbar from "./Staffnavbar";
import '../styles/Forms.css';
import { useState } from 'react';

const StaffRegister = () => {
  const[name, setName]=useState("");
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");
  const[confirmpass,setConformpass]=useState("");
  //register function
  let handleRegister=(event)=>{
    event.preventDefault;
    alert(name);
    alert(email);
    alert(password);
  }

  return (
    <>
    <Staffnavbar/>
   {/* Register form */}
    <div className='form-wrapper'>
    <h3 style={{color:"#28a745", textAlign:"center",fontSize:"2vw",padding:'0px',margin:'0px',fontWeight:"500"}}>Register form</h3>
         <p className='form-label'>Name</p>
         <input className='form-input' type='text' value={name} onChange={(event=>setName(event.target.value))}/>
         <p className='form-label'>Email</p>
         <input className='form-input' type='text' value={email} onChange={(event=>setEmail(event.target.value))}/>
         <p className='form-label'>Password</p>
         <input className='form-input' type='password' value={password} onChange={(event=>setPassword(event.target.value))}/>
         <p className='form-label'>Confirm Password</p>
         <input className='form-input' type='password' value={confirmpass} onChange={(event=>setConformpass(event.target.value))}/>
         <button className='form-button' onClick={handleRegister}>Register</button>
    </div>
    </>
  )
}

export default StaffRegister
